                    {}
                ),
                null,
                2
            )
        )
    )


    const download2 = () => (
        encodeURIComponent(
            JSON.stringify(
                (function(){
                    const o = {};
                    for (const k of Object.keys(localStorage)){
                        o[k] = JSON.parse(localStorage[k])
                    }
                    return o
                }())
                , null, 2)
        )
    )


    for (const op of [download0, download1, download2 ]){
        console.time(`Function ${op.name}`);
